import React, { useState } from 'react';

const DropDown = (videoID) => {
    return <div className='video-dropdown'>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/-JfDMJRwwFk" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
  }

export default DropDown;
